description:
On the edge of the frontier, below the setting sun four vagabonds put down their jars of moonshine and picked up instruments to form Cactus Bob. They then picked up their jars of moonshine again. The band has been driven by singer Robby Gira?s songwriting talents, combined with the arranging input and versatility of Trevor Mulvey, Aki Iwata, and Ryan Fox.

Cactus is most known for the variety of musical styles that are incorporated into the original old country concept of the music. This is mostly due to the different musical backgrounds the members come from; Trevor has studied jazz, country, latin jazz and folk in school and from private teachers, Ryan and Aki are currently studying classical music at Cal State Fullerton (Ryan-voice, Aki-guitar), and Robby gathers influence from everything he listens to.

This unique blend of influences is captured in every cactus song and performance.
